--Punto 5 
-- Crear una tabla para almacenar los puntos originales
CREATE TABLE puntos (
    id INTEGER PRIMARY KEY,
    coordenadas GEOMETRY(POINT, 4326)
);

-- Insertar las coordenadas proporcionadas en la tabla de puntos

-- Crear una tabla para almacenar el polígono y su buffer
CREATE TABLE poligonos_y_buffers (
    id SERIAL PRIMARY KEY,
    poligono geometry(POLYGON, 4326),
    zona_buffer geometry(POLYGON, 4326)
);

-- Generar el polígono a partir de los puntos y luego el buffer de 1 km
WITH puntos_ordenados AS (
    SELECT id, coordenadas
    FROM puntos
    ORDER BY id
),
poligono AS (
    SELECT ST_MakePolygon(ST_MakeLine(ARRAY(
        SELECT coordenadas
        FROM puntos_ordenados
        UNION ALL
        SELECT coordenadas
        FROM puntos_ordenados
        WHERE id = 1 -- Cierra el polígono con el primer punto
    ))) AS geom
    FROM puntos_ordenados
    LIMIT 1
)
SELECT 
    geom AS poligono,
    ST_Buffer(geom::geography, 1000)::geometry AS zona_buffer
FROM poligono;

-- Consulta para verificar el polígono y su buffer
SELECT 
    id,
    ST_AsText(poligono) AS poligono_wkt,
    ST_AsText(zona_buffer) AS buffer_wkt
FROM poligonos_y_buffers;





--Punto 6
--Interseccion del buffer con la capa indi_pv
CREATE TABLE zonas_intersecadas AS
SELECT 
    pb.id AS id_buffer,
    ip.id AS id_peligro,
    ST_Intersection(pb.zona_buffer, geom) AS geom
FROM 
    poligonos_y_buffers pb
JOIN 
    indi_pv ip
ON 
    ST_Intersects(pb.zona_buffer, geom);

-- Agregar la columna de geometría
ALTER TABLE solicitudes_nuevas
ADD COLUMN ubicacion GEOMETRY(POINT, 4326);

-- Unificar el área de estudio
CREATE TEMP TABLE zona_incidente_unificada AS
SELECT ST_Union(zona_buffer) AS geom
FROM poligonos_y_buffers;

-- Generar 150 puntos como filas individuales
CREATE TABLE puntos_generados AS
SELECT 
    row_number() OVER () AS id,
    (ST_Dump(ST_SetSRID(ST_GeneratePoints(geom, 150), 4326))).geom AS geom
FROM zona_incidente_unificada;

-- Actualizar solicitudes_nuevas con los puntos
WITH solicitudes_ordenadas AS (
    SELECT id_nueva_solicitud, ROW_NUMBER() OVER (ORDER BY id_nueva_solicitud) AS rn
    FROM solicitudes_nuevas
    WHERE ubicacion IS NULL
),
puntos_ordenados AS (
    SELECT id AS pid, geom, ROW_NUMBER() OVER (ORDER BY id) AS rn
    FROM puntos_generados
)
UPDATE solicitudes_nuevas sn
SET ubicacion = p.geom
FROM solicitudes_ordenadas s
JOIN puntos_ordenados p ON s.rn = p.rn
WHERE sn.id_nueva_solicitud = s.id_nueva_solicitud;

--Poner las coordenadas como un atributo aparte
ALTER TABLE solicitudes_nuevas
ADD COLUMN coord_x DOUBLE PRECISION,
ADD COLUMN coord_y DOUBLE PRECISION;

UPDATE solicitudes_nuevas
SET coord_x = ST_X(ubicacion),
    coord_y = ST_Y(ubicacion)
WHERE ubicacion IS NOT NULL;





--Punto 7
--Consulta 
SELECT 
    zi.id_buffer,
    zi.id_peligro,
    ip.tom_elec,
    ip.granizo,
    ip.tem_max
FROM 
    zonas_intersecadas zi
JOIN 
    indi_pv ip ON zi.id_peligro = ip.id;

--Guardar la informacion en una tabla nueva
CREATE TABLE zonas_con_peligros AS
SELECT 
    zi.id_buffer,
    zi.id_peligro,
    ip.tom_elec,
    ip.granizo,
    ip.tem_max,
    zi.geom
FROM 
    zonas_intersecadas zi
JOIN 
    indi_pv ip ON zi.id_peligro = ip.id;


--Punto 8
--Creacion de tabla con valores cuantitativos
CREATE TABLE indicador_riesgo AS
SELECT
    id_buffer,
    id_peligro,
    -- Transformar cada valor cualitativo a su equivalente numérico
    CASE tom_elec
        WHEN 'N/D' THEN 0
        WHEN 'Muy Bajo' THEN 1
        WHEN 'Bajo' THEN 2
        WHEN 'Medio' THEN 3
        WHEN 'Alto' THEN 4
        WHEN 'Muy Alto' THEN 5
        ELSE 0
    END AS tom_elec_valor,

    CASE granizo
        WHEN 'N/D' THEN 0
        WHEN 'Muy Bajo' THEN 1
        WHEN 'Bajo' THEN 2
        WHEN 'Medio' THEN 3
        WHEN 'Alto' THEN 4
        WHEN 'Muy Alto' THEN 5
        ELSE 0
    END AS granizo_valor,

    CASE tem_max
        WHEN 'N/D' THEN 0
        WHEN 'Muy Bajo' THEN 1
        WHEN 'Bajo' THEN 2
        WHEN 'Medio' THEN 3
        WHEN 'Alto' THEN 4
        WHEN 'Muy Alto' THEN 5
        ELSE 0
    END AS tem_max_valor,

    -- Suma total como indicador de riesgo
    (
        CASE tom_elec
            WHEN 'N/D' THEN 0
            WHEN 'Muy Bajo' THEN 1
            WHEN 'Bajo' THEN 2
            WHEN 'Medio' THEN 3
            WHEN 'Alto' THEN 4
            WHEN 'Muy Alto' THEN 5
            ELSE 0
        END +
        CASE granizo
            WHEN 'N/D' THEN 0
            WHEN 'Muy Bajo' THEN 1
            WHEN 'Bajo' THEN 2
            WHEN 'Medio' THEN 3
            WHEN 'Alto' THEN 4
            WHEN 'Muy Alto' THEN 5
            ELSE 0
        END +
        CASE tem_max
            WHEN 'N/D' THEN 0
            WHEN 'Muy Bajo' THEN 1
            WHEN 'Bajo' THEN 2
            WHEN 'Medio' THEN 3
            WHEN 'Alto' THEN 4
            WHEN 'Muy Alto' THEN 5
            ELSE 0
        END
    ) AS indicador_total
FROM 
    zonas_con_peligros;

SELECT * FROM indicador_riesgo;


--Punto 9 Actualizar estado de solicitudes según rangos de suma y actualizar niv_riesgo
-- Actualizar niv_riesgo con el valor de indicador_total
UPDATE solicitudes_nuevas sn
SET niv_riesgo = ir.indicador_total
FROM zonas_con_peligros zcp
JOIN indicador_riesgo ir 
  ON zcp.id_buffer = ir.id_buffer AND zcp.id_peligro = ir.id_peligro
WHERE ST_Intersects(sn.ubicacion::geometry, zcp.geom::geometry);

--Actualizar solicitudes a pendiente con un nivel de riesgo entre 11 y 15
UPDATE solicitudes_nuevas
SET estado = 'pendiente'
WHERE niv_riesgo BETWEEN 11 AND 15;


-- Actualizar solicitudes a 'factible' si suma entre 0 y 10 (Muy Bajo y Bajo)
UPDATE solicitudes_nuevas sn
SET estado = 'factible'
FROM (
    SELECT DISTINCT zcp.geom
    FROM zonas_con_peligros zcp
    JOIN indicador_riesgo ir
      ON zcp.id_buffer = ir.id_buffer AND zcp.id_peligro = ir.id_peligro
    WHERE ir.indicador_total BETWEEN 0 AND 10
) zonas_bajas
WHERE ST_Intersects(sn.ubicacion::geometry, zonas_bajas.geom::geometry);




--Punto 10 Determinar población y recursos expuestos en zonas de alto riesgo (indi_exp)
--Poblacion y recursos
-- Seleccionar zonas de alto o muy alto riesgo (indicador_total >= 16)
WITH zonas_altas AS (
    SELECT DISTINCT zcp.geom
    FROM zonas_con_peligros zcp
    JOIN indicador_riesgo ir ON zcp.id_buffer = ir.id_buffer AND zcp.id_peligro = ir.id_peligro
    WHERE ir.indicador_total >= 16
),

-- Identificar elementos expuestos dentro de esas zonas
indi_exp_en_zonas AS (
    SELECT 
        SUM(ie.pob_tot) AS total_poblacion,
        SUM(ie.pobfem) AS poblacion_femenina,
        SUM(ie.pobmas) AS poblacion_masculina,
        SUM(ie.escuelas) AS total_escuelas,
        SUM(ie.hospitales) AS total_hospitales
    FROM indi_exp ie
    JOIN zonas_altas za ON ST_Intersects(ie.geom, za.geom)
)

-- Mostrar los datos expuestos
SELECT * FROM indi_exp_en_zonas;


-- Actualizar solicitudes a 'no factible' si suma >= 16 (Alto, Muy Alto)
UPDATE solicitudes_nuevas sn
SET estado = 'no factible'
FROM (
    SELECT DISTINCT zcp.geom
    FROM zonas_con_peligros zcp
    JOIN indicador_riesgo ir
      ON zcp.id_buffer = ir.id_buffer AND zcp.id_peligro = ir.id_peligro
    WHERE ir.indicador_total >= 16
) zonas_altas
WHERE ST_Intersects(sn.ubicacion::geometry, zonas_altas.geom::geometry);


