--Paso 8: Calcular indicador de riesgo numérico
DROP TABLE IF EXISTS indicador_riesgo;
CREATE TABLE indicador_riesgo AS
SELECT 
    id_buffer,
    id_peligro,
    tom_elec,
    granizo,
    tem_max,
    CASE tom_elec
        WHEN 'N/D' THEN 0
        WHEN 'Muy Bajo' THEN 1
        WHEN 'Bajo' THEN 2
        WHEN 'Medio' THEN 3
        WHEN 'Alto' THEN 4
        WHEN 'Muy Alto' THEN 5
    END +
    CASE granizo
        WHEN 'N/D' THEN 0
        WHEN 'Muy Bajo' THEN 1
        WHEN 'Bajo' THEN 2
        WHEN 'Medio' THEN 3
        WHEN 'Alto' THEN 4
        WHEN 'Muy Alto' THEN 5
    END +
    CASE tem_max
        WHEN 'N/D' THEN 0
        WHEN 'Muy Bajo' THEN 1
        WHEN 'Bajo' THEN 2
        WHEN 'Medio' THEN 3
        WHEN 'Alto' THEN 4
        WHEN 'Muy Alto' THEN 5
    END AS indicador_total
FROM zonas_con_peligros;

-- Paso 9 y 10: Actualizar nivel de riesgo en solicitudes
ALTER TABLE solicitudes_nuevas
ADD COLUMN IF NOT EXISTS niv_riesgo INTEGER;

WITH zonas_solicitudes AS (
    SELECT 
        sn.id_nueva_solicitud,
        ir.indicador_total
    FROM solicitudes_nuevas sn
    JOIN zonas_con_peligros zcp ON ST_Intersects(sn.ubicacion, zcp.geom)
    JOIN indicador_riesgo ir ON zcp.id_buffer = ir.id_buffer AND zcp.id_peligro = ir.id_peligro
)
UPDATE solicitudes_nuevas sn
SET niv_riesgo = zs.indicador_total
FROM zonas_solicitudes zs
WHERE sn.id_nueva_solicitud = zs.id_nueva_solicitud;

--Asignar estado según nivel de riesgo
UPDATE solicitudes_nuevas
SET estado = CASE
    WHEN niv_riesgo BETWEEN 0 AND 10 THEN 'factible'
    WHEN niv_riesgo BETWEEN 11 AND 15 THEN 'pendiente'
    WHEN niv_riesgo BETWEEN 16 AND 25 THEN 'no factible'
    ELSE estado
END;

--Análisis de exposición en zonas de riesgo alto y muy alto
WITH zonas_altas AS (
    SELECT DISTINCT zcp.geom
    FROM zonas_con_peligros zcp
    JOIN indicador_riesgo ir ON zcp.id_buffer = ir.id_buffer AND zcp.id_peligro = ir.id_peligro
    WHERE ir.indicador_total BETWEEN 16 AND 25
),
indi_exp_en_zonas AS (
    SELECT
        SUM(ie.pob_tot) AS total_poblacion,
        SUM(ie.pobfem) AS poblacion_femenina,
        SUM(ie.pobmas) AS poblacion_masculina,
        SUM(ie.escuelas) AS total_escuelas,
        SUM(ie.hospitales) AS total_hospitales
    FROM indi_exp ie
    JOIN zonas_altas za ON ST_Intersects(ie.geom, za.geom)
)
