-- PROYECTO CON BUFFERS INDIVIDUALES

--Paso 5: Buffers
--Crear tabla de puntos
DROP TABLE IF EXISTS puntos;
CREATE TABLE puntos (
    id INTEGER PRIMARY KEY,
    coordenadas GEOMETRY(POINT, 4326)
);

-- Insertar puntos

--Crear buffers individuales
DROP TABLE IF EXISTS buffers_individuales;
CREATE TABLE buffers_individuales (
    id INTEGER PRIMARY KEY,
    buffer GEOMETRY(POLYGON, 4326)
);

SELECT id, ST_Buffer(coordenadas::geography, 1000)::geometry
FROM puntos;




--Paso 6: Intersección con indicadores de peligro y vulnerabilidad
DROP TABLE IF EXISTS zonas_con_peligros;
CREATE TABLE zonas_con_peligros AS
SELECT 
    b.id AS id_buffer,
    ip.id AS id_peligro,
    ip.tom_elec,
    ip.granizo,
    ip.tem_max,
    ST_Intersection(b.buffer, ip.geom) AS geom
FROM 
    buffers_individuales b
JOIN 
    indi_pv ip
ON 
    ST_Intersects(b.buffer, ip.geom);

-- Unificar buffers en una sola zona
DROP TABLE IF EXISTS zona_incidente_unificada;
CREATE TEMP TABLE zona_incidente_unificada AS
SELECT ST_Union(buffer) AS geom
FROM buffers_individuales;

--Generar puntos para georreferenciar solicitudes
DROP TABLE IF EXISTS puntos_generados;
CREATE TABLE puntos_generados AS
SELECT 
    row_number() OVER () AS id,
    (ST_Dump(ST_SetSRID(ST_GeneratePoints(geom, 150), 4326))).geom AS geom
FROM zona_incidente_unificada;

--Asignar ubicación a las solicitudes
WITH solicitudes_ordenadas AS (
    SELECT id_nueva_solicitud, ROW_NUMBER() OVER (ORDER BY id_nueva_solicitud) AS rn
    FROM solicitudes_nuevas
    WHERE ubicacion IS NULL
),
puntos_ordenados AS (
    SELECT id AS pid, geom, ROW_NUMBER() OVER (ORDER BY id) AS rn
    FROM puntos_generados
)
UPDATE solicitudes_nuevas sn
SET ubicacion = p.geom
FROM solicitudes_ordenadas s
JOIN puntos_ordenados p ON s.rn = p.rn
WHERE sn.id_nueva_solicitud = s.id_nueva_solicitud;

--Extraer coordenadas
ALTER TABLE solicitudes_nuevas
ADD COLUMN IF NOT EXISTS coord_x DOUBLE PRECISION,
ADD COLUMN IF NOT EXISTS coord_y DOUBLE PRECISION;

UPDATE solicitudes_nuevas
SET coord_x = ST_X(ubicacion),
    coord_y = ST_Y(ubicacion)
WHERE ubicacion IS NOT NULL;



--Paso 7: Consulta de grados de peligros y vulnerabilidades
SELECT 
    zi.id_buffer,
    zi.id_peligro,
    ip.tom_elec,
    ip.granizo,
    ip.tem_max
FROM 
    zonas_con_peligros zi
JOIN 
    indi_pv ip ON zi.id_peligro = ip.id;



--Paso 8: Calcular indicador de riesgo numérico
DROP TABLE IF EXISTS indicador_riesgo;
CREATE TABLE indicador_riesgo AS
SELECT 
    id_buffer,
    id_peligro,
    tom_elec,
    granizo,
    tem_max,
    CASE tom_elec
        WHEN 'N/D' THEN 0
        WHEN 'Muy Bajo' THEN 1
        WHEN 'Bajo' THEN 2
        WHEN 'Medio' THEN 3
        WHEN 'Alto' THEN 4
        WHEN 'Muy Alto' THEN 5
    END +
    CASE granizo
        WHEN 'N/D' THEN 0
        WHEN 'Muy Bajo' THEN 1
        WHEN 'Bajo' THEN 2
        WHEN 'Medio' THEN 3
        WHEN 'Alto' THEN 4
        WHEN 'Muy Alto' THEN 5
    END +
    CASE tem_max
        WHEN 'N/D' THEN 0
        WHEN 'Muy Bajo' THEN 1
        WHEN 'Bajo' THEN 2
        WHEN 'Medio' THEN 3
        WHEN 'Alto' THEN 4
        WHEN 'Muy Alto' THEN 5
    END AS indicador_total
FROM zonas_con_peligros;

-- Paso 9 y 10: Actualizar nivel de riesgo en solicitudes
ALTER TABLE solicitudes_nuevas
ADD COLUMN IF NOT EXISTS niv_riesgo INTEGER;

WITH zonas_solicitudes AS (
    SELECT 
        sn.id_nueva_solicitud,
        ir.indicador_total
    FROM solicitudes_nuevas sn
    JOIN zonas_con_peligros zcp ON ST_Intersects(sn.ubicacion, zcp.geom)
    JOIN indicador_riesgo ir ON zcp.id_buffer = ir.id_buffer AND zcp.id_peligro = ir.id_peligro
)
UPDATE solicitudes_nuevas sn
SET niv_riesgo = zs.indicador_total
FROM zonas_solicitudes zs
WHERE sn.id_nueva_solicitud = zs.id_nueva_solicitud;

--Asignar estado según nivel de riesgo
UPDATE solicitudes_nuevas
SET estado = CASE
    WHEN niv_riesgo BETWEEN 0 AND 10 THEN 'factible'
    WHEN niv_riesgo BETWEEN 11 AND 15 THEN 'pendiente'
    WHEN niv_riesgo BETWEEN 16 AND 25 THEN 'no factible'
    ELSE estado
END;

--Análisis de exposición en zonas de riesgo alto y muy alto
WITH zonas_altas AS (
    SELECT DISTINCT zcp.geom
    FROM zonas_con_peligros zcp
    JOIN indicador_riesgo ir ON zcp.id_buffer = ir.id_buffer AND zcp.id_peligro = ir.id_peligro
    WHERE ir.indicador_total BETWEEN 16 AND 25
),
indi_exp_en_zonas AS (
    SELECT
        SUM(ie.pob_tot) AS total_poblacion,
        SUM(ie.pobfem) AS poblacion_femenina,
        SUM(ie.pobmas) AS poblacion_masculina,
        SUM(ie.escuelas) AS total_escuelas,
        SUM(ie.hospitales) AS total_hospitales
    FROM indi_exp ie
    JOIN zonas_altas za ON ST_Intersects(ie.geom, za.geom)
)
SELECT * FROM indi_exp_en_zonas;
